<!DOCTYPE html>
<html lang="ko">

<head>
  <meta charset="UTF-8">
  <meta name="viewport" content="initial-scale=1.0, minimum-scale=1.0, width=device-width, viewport-fit=cover">
  <meta http-equiv="X-UA-Compatible" content="IE=edge">
  <title>에러 페이지</title>
  <style>
    body {
      font-family: -apple-system, BlinkMacSystemFont, Roboto,
        RobotoDraft, '맑은고딕', Malgun Gothic, Sans-serif;
      line-height: 1.5;
    }

    body,
    div,
    ul,
    li,
    h1,
    h2,
    h3,
    p {
      margin: 0;
      padding: 0
    }

    fieldset,
    img {
      border: 0 none
    }

    ul,
    ol,
    li {
      list-style: none
    }

    .logo {
      position: fixed;
      top: 70px;
      left: 94px;
    }

    .error {
      position: fixed;
      top: 50%;
      left: 50%;
      transform: translate(-50%, -50%);
      display: flex;
      flex-direction: column;
      align-items: center;
    }

    .error__img {
      margin-bottom: 25px;
    }

    .error__title {
      color: #F66C00;
      font-size: 36px;
      font-weight: 700;
    }

    .error__description {
      margin-top: 12px;
      color: #606974;
      font-size: 26px;
      font-weight: 500;
      text-align: center;
    }

    .error__list {
      width: 821px;
      display: flex;
      flex-direction: column;
      align-items: flex-start;
      margin-top: 40px;
      padding: 24px;
      gap: 8px;
      border-radius: 10px;
      box-sizing: border-box;
      background-color: #F7F9FC;
    }

    .error__item {
      position: relative;
      padding-left: 32px;
      color: #454545;
      font-size: 20px;
      font-weight: 400;
    }

    .error__item::before {
      content: '';
      position: absolute;
      top: 50%;
      left: 16px;
      margin-top: -2px;
      width: 4px;
      height: 4px;
      border-radius: 100%;
      background-color: #454545;
    }
  </style>
</head>
